// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import { LibDiamond } from "../libraries/LibDiamond.sol";
import "../interfaces/IVaultPenaltyFacet.sol";
import "../interfaces/IKIP7.sol";
import "../utils/math/SafeMath.sol";
import "../interfaces/IUsageFacet.sol";
import "../interfaces/IRewardFacet.sol";


contract VaultPenaltyFacet is IVaultPenaltyFacet {
    using SafeMath for uint256;

    uint256 constant private MULTIPLIER_DIVISOR = 10;
    string constant private KEY_LOCK_PERIOD = "lock_period";
    string constant private KEY_LOCK_COUNT = "lock_count";
    string constant private BURN_ADDRESS_KEY = "VaultPenaltyFacet.burn_address";
    string constant private PENALTY_ADDRESS_KEY = "VaultPenaltyFacet.penalty_address";


    event finixClaimWithPenalty(address _user,uint256 _lockAmount,uint256 _penaltyAmount, uint256 _lockIndex);

    function claimWithPenalty(uint256 _lockIndex) external override{
            LibDiamond.DiamondStorage storage ds = LibDiamond.diamondStorage();
            // Get FINIX Address from Eternal Storage
            address FINIX = LibDiamond.getAddress(
                keccak256(abi.encodePacked("FINIX"))
            );
            // TDO: Yield Operation
            address burnAddress = getBurnAddress();
            address penaltyFinixAddress = getPenaltyFinixAddress();
            IRewardFacet(address(this)).harvest(burnAddress);
            // Get Lock info
            bytes32 key = keccak256(abi.encode(msg.sender, _lockIndex));
            LibDiamond.LockInfo storage lockInfo_ = ds.locksMap[key];


            require(lockInfo_.isUnlocked == false,"vFinixVault: This has already been unlocked.");
            require(lockInfo_.isPenalty == true ,"VFinixVault: You are not being penalty");

            (, , ,uint256 penaltyPeriod_,uint256 penaltyRate_,uint256 penaltyRateDecimal_) = _getLockPerioid(lockInfo_.level);
            require(block.timestamp > lockInfo_.penaltyUnlockTimestamp + penaltyPeriod_ ,"VFinixVault: You are in penalty time");
            // calculate penalty finix
            uint256 penaltyAmount = lockInfo_.lockAmount.mul(penaltyRate_).div(penaltyRateDecimal_);
            // Mark Unlock
            lockInfo_.isUnlocked = true;
            // Burn vFinix
            _burnVFinix(burnAddress, lockInfo_.voteAmount);
            // Decreaase total Lock Amount
            uint256 userLocksAmount_ = ds.userLocksAmount[msg.sender];
            ds.userLocksAmount[msg.sender] = userLocksAmount_.sub(lockInfo_.lockAmount);
            // Transfer back FINIX
            // _calculatePenaltyFinix(lockInfo_.lockAmount,)

            IKIP7(FINIX).transfer(msg.sender, lockInfo_.lockAmount.sub(penaltyAmount));
            IKIP7(FINIX).transfer(penaltyFinixAddress, penaltyAmount);
            lockInfo_.penaltyFinixAmount = penaltyAmount;
            // update lock data
            _decreaseTotalLockCount();
            _decreaseTotalLevelLockCount(lockInfo_.level);
            ds.totalFinixLockAtLevel[lockInfo_.level] = ds.totalFinixLockAtLevel[lockInfo_.level].sub(lockInfo_.lockAmount);
            ds.totalFinixLock = ds.totalFinixLock.sub(lockInfo_.lockAmount);
            // emit finixClaimWithPenalty(msg.sender, lockInfo_.level, lockInfo_.lockAmount, lockInfo_.voteAmount, lockInfo_.penaltyUnlockTimestamp , _lockIndex, key);
            emit finixClaimWithPenalty(msg.sender, lockInfo_.lockAmount, penaltyAmount, _lockIndex);
    }
